const generateMessages = (start = Date.now() - 86400000 * 7, users: User[]) => {
  const messages = [];
  let lastMessage = start;
  for (let i = 0; i < Math.floor(Math.random() * 50 + 10); i++) {
    lastMessage = lastMessage - Math.floor(Math.random() * 86400000 * 7)
    messages.push({
      id: Math.random().toString(36).slice(2),
      content: getLipsum(),
      time: lastMessage,
      author: users[Math.floor(Math.random() * users.length)],
    });
  }
  return messages.reverse();
};
const getConversation = () => {
  // Time should have the following with probability:
  // Anytime Today: 5%
  // Yesterday: 10%
  // Last 7 days: 10%
  // Last 30 days: 20%
  // Last 90 days: 30%
  // Last 365 days: 20%
  // Last 5 years: 5%
  const time = (() => {
    const r = Math.random();
    if (r < 0.05) {
      return Date.now() - Math.floor(Math.random() * 86400000);
    } else if (r < 0.15) {
      return Date.now() - Math.floor(Math.random() * 86400000 * 7);
    } else if (r < 0.25) {
      return Date.now() - Math.floor(Math.random() * 86400000 * 30);
    } else if (r < 0.55) {
      return Date.now() - Math.floor(Math.random() * 86400000 * 90);
    } else if (r < 0.75) {
      return Date.now() - Math.floor(Math.random() * 86400000 * 365);
    } else {
      return Date.now() - Math.floor(Math.random() * 86400000 * 365 * 5);
    }
  })();
  const id = Math.random().toString(36).slice(2);
  const users = [getRandomUser(), onlyClient];
  return {
    id,
    name: users[0].name,
    lastMessageTime: time,
    messages: generateMessages(time, users),
    users,
  } as Conversation;
};
